"fixed": |-
  1. (N) A set of IEEE standards, which has eight parts: (a) Model, including security management, (b) Secure Data Exchange protocol, (c) Key Management, (d) [has been incorporated in (a)], (e) SDE Over Ethernet 2.0, (f) SDE Sublayer Management, (g) SDE Security Labels, and (h) SDE PICS Conformance. Parts b, e, f, g, and h are incorporated in IEEE Standard 802.10-1998.
"ko": |-
  1. (N) 8개 부분으로 구성된 IEEE 표준 세트: (a) 보안 관리를 포함한 모델, (b) 보안 데이터 교환 프로토콜, (c) 키 관리, (d) [(a)에 통합되었습니다. ], (e) 이더넷을 통한 SDE 2.0, (f) SDE 하위 계층 관리, (g) SDE 보안 레이블 및 (h) SDE PICS 적합성. b, e, f, g 및 h 부분은 IEEE 표준 802.10-1998에 통합되어 있습니다.
